import React from 'react';

const Projects = () => {
  return (
    <section className="projects" id="projects">
      <div className="projects-content">
        <h1>Our Projects</h1>
        <p>At ASRC Bootcamp, we believe in learning by doing Projects / Tutorials</p>
      </div>
    </section>
  );
}

export default Projects;
